import React, { useState, useMemo } from "react";
import PracticeConsole from "../components/PracticeConsole";

const BACKTRACKING_QUESTIONS = [
  { title: "Letter Combinations of a Phone Number" },
  { title: "Generate Parentheses" },
  { title: "Combination Sum" },
  { title: "Permutations" },
  { title: "N-Queens", image: "/nqueens.png" },
  { title: "Subsets" },
  { title: "Palindrome Partitioning" },
];

export default function TopicPractice() {
  const questions = BACKTRACKING_QUESTIONS;

  const [index, setIndex] = useState(0);
  const [status, setStatus] = useState(
    Array(questions.length).fill("unattempted")
  );

  /* ---------------- PROGRESS CALC ---------------- */

  const progress = useMemo(() => {
    const completed = status.filter(
      (s) => s === "correct" || s === "wrong" || s === "skipped"
    ).length;
    return Math.round((completed / questions.length) * 100);
  }, [status, questions.length]);

  const isCompleted = progress === 100;

  /* ---------------- SUBMIT HANDLER ---------------- */

  function handleSubmit(isCorrect) {
    const updated = [...status];
    updated[index] = isCorrect ? "correct" : "wrong";
    setStatus(updated);
  }

  function nextQuestion() {
    const updated = [...status];

    if (updated[index] === "unattempted") {
      updated[index] = "skipped";
    }

    setStatus(updated);

    if (index + 1 < questions.length) {
      setIndex(index + 1);
    }
  }

  /* ---------------- CLICK QUESTION ---------------- */

  function jumpToQuestion(i) {
    setIndex(i);
  }

  return (
    <div style={{ padding: "50px", background: "#f8fafc", minHeight: "100vh" }}>

      {/* --------- TOP HEADER --------- */}

      <h1 style={{ fontSize: 28, marginBottom: 20 }}>
        Backtracking
      </h1>

      {/* --------- PROGRESS BAR --------- */}

      <div style={{ marginBottom: 30 }}>
        <div style={{ fontWeight: 600, marginBottom: 8 }}>
          Your Progress : <span style={{ color: "#22c55e" }}>{progress}% Completed</span>
        </div>

        <div
          style={{
            height: 10,
            width: "100%",
            background: "#e2e8f0",
            borderRadius: 50,
            overflow: "hidden",
          }}
        >
          <div
            style={{
              height: "100%",
              width: `${progress}%`,
              background: "linear-gradient(90deg,#22c55e,#16a34a)",
              borderRadius: 50,
              transition: "width 0.4s ease",
            }}
          />
        </div>
      </div>

      {/* --------- COMPLETED BADGE --------- */}

      {isCompleted && (
        <div
          style={{
            background: "#22c55e",
            color: "#fff",
            padding: "10px 20px",
            borderRadius: 50,
            display: "inline-block",
            marginBottom: 25,
            fontWeight: 600,
          }}
        >
          âœ… Completed Topic
        </div>
      )}

      {/* --------- QUESTION NUMBER BAR --------- */}

      <div style={{ display: "flex", gap: 10, marginBottom: 30 }}>
        {questions.map((_, i) => (
          <div
            key={i}
            onClick={() => jumpToQuestion(i)}
            style={{
              width: 45,
              height: 45,
              borderRadius: 12,
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              fontWeight: 600,
              cursor: "pointer",
              transition: "all 0.3s ease",
              background:
                status[i] === "correct"
                  ? "#22c55e"
                  : status[i] === "wrong"
                  ? "#ef4444"
                  : status[i] === "skipped"
                  ? "#8b5cf6"
                  : "#e2e8f0",
              color:
                status[i] === "unattempted" ? "#1e293b" : "#fff",
            }}
          >
            {i + 1}
          </div>
        ))}
      </div>

      {/* --------- MAIN LAYOUT --------- */}

      <div style={{ display: "flex", gap: 40 }}>

        {/* LEFT SIDE */}

        <div
          style={{
            flex: 1,
            background: "#ffffff",
            padding: 30,
            borderRadius: 20,
            boxShadow: "0 10px 40px rgba(0,0,0,0.05)",
          }}
        >
          <h2 style={{ marginBottom: 20 }}>
            {questions[index].title}
          </h2>

          {questions[index].image && (
            <img
              src={questions[index].image}
              alt="visual"
              style={{
                marginTop: 20,
                width: "100%",
                borderRadius: 12,
              }}
            />
          )}
        </div>

        {/* RIGHT SIDE */}

        <div
          style={{
            flex: 1.2,
            background: "#ffffff",
            padding: 30,
            borderRadius: 20,
            boxShadow: "0 10px 40px rgba(0,0,0,0.05)",
          }}
        >
          <PracticeConsole />

          <div style={{ marginTop: 20, display: "flex", gap: 15 }}>
            <button
              onClick={() => handleSubmit(true)}
              style={{
                padding: "10px 20px",
                background: "#22c55e",
                color: "#fff",
                borderRadius: 10,
                border: "none",
                cursor: "pointer",
              }}
            >
              Submit (Correct)
            </button>

            <button
              onClick={() => handleSubmit(false)}
              style={{
                padding: "10px 20px",
                background: "#ef4444",
                color: "#fff",
                borderRadius: 10,
                border: "none",
                cursor: "pointer",
              }}
            >
              Submit (Wrong)
            </button>

            <button
              onClick={nextQuestion}
              style={{
                padding: "10px 20px",
                background: "#6366f1",
                color: "#fff",
                borderRadius: 10,
                border: "none",
                cursor: "pointer",
              }}
            >
              Next
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}
